import React from 'react'
import Table from "./Table";

function Home() {
    const mystyle = {
        'margin-top': '30px',
        'display': 'flex',
        'justify-content': 'center',
        'align-item': 'center'
    };

    let array = [{id:"1", name:"tomer", age:"30", gender:"male", city:"Israel"}]

    return (
        <div id="reports" style={mystyle} className="container">
            <h2>Report</h2>
            <Table data={array}></Table>


        </div>
    );
}

export default Home;
